import "./Screen1.css";
import 'font-awesome/css/font-awesome.min.css';


function Screen1(){
    return(
        <div style={{backgroundColor:"lightblue"}} id="div">
            <fieldset>
            <br/><br/>
            <h4>get started</h4>
            <input type="text"/>
            <br></br>
            <button type="text" style={{backgroundColor:"lightcoral"}} >continue</button>
            <br/><br/>
            <h6>Or continue  width</h6>
            <br/>
            <i class="fa fa-whatsapp" aria-hidden="true"></i> <input type="text"  style={{color:"greenyellow"}} placeholder="whatsApp"/> <i class="fa fa-google" aria-hidden="true"></i><input type="text" style={{color:"blue"}} placeholder="Google"/>
            <br/><br/>
            <h6>By continue you agree to our terms and polices</h6>
            </fieldset>

        </div>
    )
}
export default Screen1;
